import React from 'react';
import './Skill.css';
import Card from './Card';
export default function Skill(){
    return(
        <>
        <div className="s"  id='s'>
           <div className="s-title">
               <h2>Services</h2>
               <h4>I Design,I Code,I Create : It's that simple</h4>
               <div className="s-wrapper">
                   <Card />
               </div>
           </div>
        </div>
        </>
    )
}
